struct frameBuffer {
	unsigned int volatile buffer;
	unsigned int backBuffer;
	unsigned int volatile resolution;
	unsigned int statusControl;
};

volatile unsigned int* const front4Hex = 0xFF200020;
volatile unsigned int* const last2Hex = 0xFF200030;

struct Bullet {
	int LR; // direction of movement
	int DU; // direction of movement
	int xVel;
	int yVel;
	int x;
	int y;
	int length;
	
	int xErase;
	int yErase;
	int xNew;
	int yNew;
	int toErase;
};

struct initPos {
	int x;
	int y;
	int U; //direction of rotation
  int D;
  int L;
  int R;
};

struct movement {
	int n;
	int e;
	int s;
	int w;
};


void swap(int* x, int* y) {
	int temp = *x;
	*x = *y;
	*y = temp;
}

int abs(int x) {
	if (x < 0) {
		return -1 * x;	
	} else {
		return x;	
	}
}

void start_match(struct frameBuffer * const fbPtr) {
	int num = 0x7306;
	*last2Hex = num;
	
	num = 0x4F735B4F;
	*front4Hex = num;
	screen = 2;
	
	draw_background();
	wait_for_vsync();
    bufferToDrawPtr = fbPtr->backBuffer;
	draw_background();
}

void end_match(struct frameBuffer * const fbPtr) {
	//print end screen & update to who wins in separate func
	int num;
	if (tank1Lives == 0) {
		num = 0x735B;
	} else {
		num	= 0x7306;
	}

	*last2Hex = num;

	num = 0x313E3879;
	*front4Hex = num;
	
	screen = 3;
	
	draw_background();
	wait_for_vsync();
    bufferToDrawPtr = fbPtr->backBuffer;
	draw_background();
}

