void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
	int is_steep;
	if (abs(y1 - y0) > abs(x1 - x0)) {
		is_steep = 1;	
	} else {
		is_steep = 0;	
	}
	
	if (is_steep == 1) {
		swap(&x0, &y0);
		swap(&x1, &y1);
	} 
	
	if (x0 > x1) {
		swap(&x0, &x1);
		swap(&y0, &y1);
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1-y0);
	int error = -(deltax / 2);
	int y = y0;
	
	int y_step;
	if (y0 < y1) {
		y_step = 1;	
	} else {
		y_step = -1;
	}
	
	for (int x = x0; x < x1; x++) {
		if (is_steep == 1) {
			plot_pixel(y, x, line_color); 	
		} else {
			plot_pixel(x, y, line_color);	
		}
		
		error = error + deltay;
		
		if (error > 0) {
			y = y + y_step;
			error = error - deltax;
		}
	}
}

