void animate (int* x, int* y, int width, int height, int xVel, int yVel, int* LR, int* DU, 
			  int* xErase, int* yErase, int* xNew, int* yNew) {
	flipLR(*x, *y, LR, DU, width, height);
	flipDU(*x, *y, LR, DU, width, height);
	
	if (*LR != -2) *x = change ? *LR ? *x + xVel : *x - xVel : *x;
	if (*DU != -2) *y = change ? *DU ? *y - yVel : *y + yVel : *y;
	
	*xErase = *xNew;
	*yErase = *yNew;
	*xNew = *x;
	*yNew = *y;
}

