void check_collision(struct initPos tankPos, int num, struct Bullet* b) {
	if (tankPos.x + tankColSize < b->x || b->x + b->length < tankPos.x || tankPos.y + tankRowSize < b->y || b->y + b->length < tankPos.y) return;
	b->toErase = 1;
	b->LR = -1;
	erase(b->x, b->y, b->length, b->length);
	if (num == 1) {
		tank1Lives--;
		int num = *front4Hex;
		
		if (tank1Lives == 0) return;
		
		if (tank1Lives == 2) {
			num = num & 0b0000000011111110111111101111111;
			num = num | 0b1011011000000000000000000000000;
		} else if (tank1Lives == 1) {
			num = num & 0b0000000011111110111111101111111;
			num = num | 0b0000110000000000000000000000000;
		}
		
		*front4Hex = num;
	} else {
		tank2Lives--;
		
		if (tank2Lives == 0) return;
		int num = *front4Hex;

		if (tank2Lives == 2) {
			num = num & 0b1111111011111110111111100000000;
			num = num | 0b1011011;
		} else if (tank2Lives == 1) {
			num = num & 0b1111111011111110111111100000000;
			num = num | 0b0000110;
		}
		
		*front4Hex = num;
	}
}

void animate_tank(struct initPos* tank, int U, int D, int L, int R) {
	if (L == 1 || R == 1) {
		int boundaryLRHit = LRBoundary(tank->x, tank->y, L == 1 ? 0 : 1, tankColSize, tankRowSize);
		if (boundaryLRHit == 0 && L == 1 && change == 1) {
			tank->x--;
		} else if (boundaryLRHit == 0 && R == 1 && change == 1) {
			tank->x++;
		}
	}
	if (U == 1 || D == 1) {
		int boundaryUDHit = UDBoundary(tank->x, tank->y, D == 1 ? 0 : 1, tankColSize, tankRowSize); 
		if (boundaryUDHit == 0 && U == 1 && change == 1) {
			tank->y--;
		} else if (boundaryUDHit == 0 && D == 1 && change == 1) {
			tank->y++;
		}
	}
}



